import React from "react";
import Button from "./Button";

export default class Dashboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.logoutFunction = this.logoutFunction.bind(this);
  }
  // Variables
  userData = this.props.userData;

  logoutFunction = () => {
    // Usuwanie ciasteczka z emailem i przeladowanie strony
    document.cookie = "email='';expires = 01 Jan 1970 00:00:00 UTC; path=/;";
    window.location.href = "";
  };

  render() {
    return (
      <div>
        {this.userData !== null ? (
          <Button>+1 from active {`(` + this.userData + `)`}</Button>
        ) : (
          <div></div>
        )}

        <Button>Choose active pack</Button>
        <Button>Add new pack</Button>
        <div onClick={this.logoutFunction}><Button>Log Out</Button></div>
      </div>
    );
  }
}
